import React from 'react';
import './Weather.css';


const Weather = (props) => {
  return(
      <div className="WeatherList-item">
          <h2>{props.data.name}</h2>
          <h2>{props.data.temp}</h2>
          <h3>{props.data.id}</h3>
      </div>

    );

};


const WeatherList = (props) => {

    const data = props.data;
    const weatherList = data.map((data) =>

        <div className="WeatherList">
            <Weather data={data} key={data.id}/>
        </div>

    );

    return (

        <div>{weatherList}</div>

    );

};

export default WeatherList;
